@Google @GoogleIndia Today I am setting my new mobile #Redmi5 with starting procedure, after that I have connected Wi-Fi to it and then I am surprised that first notification is that 
Allow google to track your location while offline.
@sharadsharma1 @ndtv @abpnewstv

@praviin11 Just small info: you can't enable location of your device from remote location.

Though, if it's already enabled you can track down the exact location using Android Device Manager's "Find My Phone"
And also can ring up the phone

@JoelOsteen I refuse in Jesus name familiarity will not stop me from my destiny neither my work place, my location where i live now and my friends.
The God i am saving daily will make me grow spriritual and keep me in right track as i  run  my race to finishing point.

Amen

Big #Security Story this week Read and watch again Why you can't defeat #Google #locationtracking even if you turn it off
@Google services on #Android and #iPhone still track users even if privacy settings instruct it not to. 
